    <div className='country'>
      <p>Country: {country.name.official}</p>
      <p>Area: {country.area} </p>
    </div>
  )
}

const App = (props) => {
  return (
    <div>
      {countries.map(country => <CountryInfo key={country.cca3} country={country} />)}
    </div>
  )
}

export default App
